window.bookSummaryJSON = "<p><i>Habitats </i>is the seventh in a series of near future sci-fi/thrillers, whose young heroine Ell Donsaii has a nerve mutation which has made her a genius as well as an athletic phenomenon.</p> <p>In <i>Habitats</i>, she is continuing to find uses for the quantum-entangled wormholes she discovered. These wormholes arenâ€™t big enough to send people through, yet they are making huge changes in our world.</p> <p>After a friend lost his hand, Ell finds a way to use ports to build better prostheses for amputees! However, there are terrorists wanting to use ports to cause destruction and the military arms of some countries covet them, as well. Ell must try to prevent such people from obtaining the technology and using it for harm. Meanwhile, her small company is trying to build a habitat in space, and one of her rockets has discovered a mind-boggling habitat at Sigma Draconis.</p>"; 
